console.log(tareas);

class App extends Component {

  constructor() {
    super();
    this.state = {
      title: "Lista de tareas",
      nrotareas: 5
    }
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
        <div>
        <Navigation title={this.state.title} />
        <Navigation title="" />
        </div>
        </header>
      </div>
    );
  }
}

export default App;
